import axios from "axios";

export function getUserDetails(){
    return axios.get(process.env.REACT_API_APP_URL+"/api/user", {
        withCredentials: true
    });
}

export function getCharacters(){
    return axios.get(process.env.REACT_API_APP_URL+"/api/character", {
        withCredentials: true
    });
}
